1. Lave as mãos até o pulso com água e sabão 🧼 por, pelo menos, 20 segundos;

2. Use álcool gel para limpar as mãos 👐 e aguarde a secagem;

3. Evite multidões;

4. Apesar de o contato em elevadores não ser considerado próximo, caso trabalhe em um prédio  🏢 administrativo, se preferir, use as escadas. É muito importante adotar os hábitos citados anteriormente em caso de espirros e tosse;

5. O uso de máscara  só é indicado para pessoas com sintomas respiratórios (como tosse, espirro ou falta de ar) ou profissionais de saúde;

6. Não aperte as mãos  🤝 ou beije 💋 ao cumprimentar;

7. Limpe objetos tocados como celular  e telefone fixo  com álcool gel;

8. Higienize mesas, bancadas e materiais compartilhados (como telefone fixo) com álcool gel no início e no fim de seu turno. O uso de álcool gel não é indicado em teclados 💻 e telas 🖥 de computadores, por risco de danos. Por isso, é essencial a conscientização sobre manter mãos sempre higienizadas;

9. Ao tossir  ou espirrar, leve seu rosto à parte interna do cotovelo e higienize a área com álcool gel em seguida;

10. Evite tocar nariz 👃, olhos 👀 e boca 👄;

11. Caso seja possível, recomendamos espaçar as estações de trabalho 💻 neste período.

Se possível, tire as roupas e calçados antes de entrar em casa (deixe sempre uma muda de roupa pronta ao sair).

Se precisar trazer as roupas para dentro, coloque-as em um saco plástico;

Se possível, lave as mãos na área externa da casa;

Se não puder lavar as mãos antes de entrar, evite tocar nas coisas antes de lavar as mãos;

Não cumprimente crianças 👦🏻 👧🏻 , cônjuges ou outras pessoas que morem na casa antes de trocar de roupa e lavar as mãos;

Se possível, tome banho assim que chegar;

Desinfete celular 📱, chaves 🔑 e cartões 💳 bancários com álcool a 70%;

Mochilas e bolsas de uso diário devem ficar em uma caixa 📦, na área externa da casa;

Limpe as embalagens que trouxe com solução de água sanitária (20 ml para cada 1 litro de água);

Lave alimentos com água e sabão e os deixe 10 minutos imersos em solução de água sanitária (20 ml para cada 1 litro de água).

O vírus pode ser transmitido através de:

• Gotículas de saliva;
• Espirro;
• Tosse 🤧;
• Catarro;
• Contato pessoal próximo (menos de dois metros de distância por mais de 15 minutos)
• Toque ou aperto de mão 🤝;
• Contato com objetos ou superfícies contaminadas (como maçaneta, corrimão e telefones).
